"<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; line-height:200%;\">Multiple sums: Select all the target cells at once, and press the shortcut to calculate sums for </p>\n"
